    true,nt"url": null,nt"notes": "The Limb Infrared Monitor of the Stratosphere
    (LIMS) version 6 Level-3 data product consists of daily, 2 degree zonal Fourier
    coefficients, of vertical profiles of temperature, geopotential height, and mixing
    ratios of ozone (O3), nitrogen dioxide (NO2), water vapor (H2O), and nitric acid
    (HNO3). The data are on 28 pressure levels, equally spaced logarithmically, between
    316 hPa and 0.01 hPa. These data supercede the previous version 5 products, known
    as the LIMS Map Archival Tape (LAMAT) and the LIMS Seasonal Map Archival Tape (LASMAT).
    Version 6 data have improved accuracy and precision of measured geophysical parameters.
    The data files are in an ASCII text format. The LIMS instrument was launched on
    the Nimbus-7 satellite and was operational from 25 October 1978 until May 28, 1979.nnParameters
    contained in the data files include the following:nVariable Name|Description|UnitsnO3|Ozone
    (O<sub>3</sub>) Volume Mixing Ratio|mol/molnNO2|Nitrogen Dioxide (NO<sub>2</sub>)
    Volume Mixing Ratio|mol/molnH2O|Water Vapor (H<sub>2</sub>O) Volume Mixing Ratio|mol/molnHNO3|Nitric
    Acid (HNO<sub>3</sub>) Volume Mixing Ratio|mol/molnT|Temperature Profile|KnGPH|Geopotential
    Height|mnEnd of parameter information",nt"license_title": "U.S. Government
